import React from 'react';
import { Link } from 'react-router-dom';
import { ShoppingOutlined, HomeOutlined, ShopOutlined } from '@ant-design/icons';
import { Menu, Dropdown,
} from 'antd';
import DropdownUser from '../dropdown-user/dropdown-user.component';
import CartDropDown from '../card-dropdown/card-dropdown.component';

const RightNavigation = () => (
  <Menu
    style={{ float: 'right' }}
    theme="dark"
    mode="horizontal"
    defaultSelectedKeys={['1']}
  >
    <Menu.Item
      key="1"
      icon={(
        <Link to="/">
          <HomeOutlined style={{ fontSize: '25px', paddingTop: '10px' }} />
          Home
        </Link>
      )}
    >
      {' '}

    </Menu.Item>
    <Menu.Item
      icon={(
        <Link to="/productQuery">
          <ShopOutlined
            style={{ fontSize: '25px', paddingTop: '10px' }}
          />
          Product
        </Link>
        )}
      key="2"
    />
    <Menu.Item
      icon={(
        <Link to="/checkout">
          <ShoppingOutlined
            style={{ fontSize: '25px', paddingTop: '10px' }}
          />
          Cart
        </Link>
        )}
      key="3"
    />

    <Dropdown
      overlay={DropdownUser}
      overlayStyle={{ width: '200px' }}
      placement="topCenter"
    >
      <Link to="/user"> Thuong Le </Link>
    </Dropdown>
    <CartDropDown />
  </Menu>
);

export default RightNavigation;
